import styled from 'styled-components';

export const HeaderWrapper = styled.div`
    border-bottom: 1px solid #f0f0f0;
    height: 56px;
    position: relative;
`;

export const Logo = styled.a`
    background: orange;
    dispay: block;
    height: 56px;
    left: 0;
    position: absolute;
    top: 0;
    width: 100px;
`;
